import React from "react";
import LoginCard from "../Signup/LoginCard";
// import Checked from "../image/security.svg";


const Login = () =>{
    return(
        <>
            <div className="container-fluid">
                <div className='row'>

                    <div className="col-12 col-md-12 col-lg-12 col-sm-12 mx-auto">

                        <div className="row LoginBox">
                        <h1 className="text-center login_head">LOGIN</h1>



                        </div>


                    </div>


                </div>
            </div>
        </>
    )
}

export default Login;
